import UIKit

protocol ImageProviderType {
    var bumperPoweredByImage: UIImage { get }
    var bumperBackgroundImage: UIImage { get }
    var closeImage: UIImage { get }
    var safeAdImage: UIImage { get }
}

// swiftlint:disable line_length
class ImageProvider: ImageProviderType {

    lazy var bumperPoweredByImage: UIImage = {
        let base64Image = ""
        return makeImage(from: base64Image)
    }()

    lazy var bumperBackgroundImage: UIImage = {
        let base64Image = ""
        return makeImage(from: base64Image)
    }()

    lazy var closeImage: UIImage = {
        let base64Image = ""
        return makeImage(from: base64Image)
    }()

    lazy var safeAdImage: UIImage = {
        let base64Image = ""
        return makeImage(from: base64Image)
    }()

    private func makeImage(from: String) -> UIImage {
        let imageData = Data(base64Encoded: from, options: .ignoreUnknownCharacters)
        return UIImage(data: imageData!)!
    }
}
